        <header className="App-header">
            <nav>
                <NavLink to="/" activeClassName="active" className="navLinks">Home</NavLink> { '  or  ' }
                <NavLink to="/userToDos" className="navLinks">To Do</NavLink>
            </nav>
        </header>

    )
}

export default PostsHeader
